import React from 'react';
import logo from './pages/images/logo.png';
import { Breadcrumb, Layout, Menu, theme, Typography } from 'antd';

const { Header } = Layout;
const { Text } = Typography; 
const App: React.FC = () => {
  const {
    token: { colorBgContainer },
  } = theme.useToken();

  return (
    <Layout>
      <Header
        style={{
          position: 'sticky',
          top: 0,
          zIndex: 1,
          width: '100%',
          display: 'flex',
          alignItems: 'center',
        }}
      >
        <div className="demo-logo" />
        <Menu
          theme="dark"
          mode="horizontal"
          defaultSelectedKeys={['2']}
          items={new Array(3).fill(null).map((_, index) => ({
            key: String(index + 1),
            label: `nav ${index + 1}`,
          }))}
        />
      </Header>
      <Content className="site-layout" style={{ padding: '0 50px' }}>
        <Breadcrumb style={{ margin: '16px 0' }}>
          <Breadcrumb.Item>Home</Breadcrumb.Item>
          <Breadcrumb.Item>List</Breadcrumb.Item>
          <Breadcrumb.Item>App</Breadcrumb.Item>
        </Breadcrumb>
        <div style={{ padding: 24, minHeight: 380, background: colorBgContainer }}>Content</div>
      </Content>
      <Footer style={{ textAlign: 'center' }}>Ant Design Â©2023 Created by Ant UED</Footer>
    </Layout>
  );
};

function NavTabs({ currentPage, handlePageChange }) {
  return (
    <Header
      style={{
        position: 'sticky',
        top: 0,
        zIndex: 1,
        width: '100%',
        display: 'flex',
        alignItems: 'center',
      }}
    >
      <div className="logo">
        <img src={logo} alt="Travel Bug Logo" style={{ width: '200px', height: '50px' }} />
      </div>
      <Menu
        theme="dark"
        mode="horizontal"
        defaultSelectedKeys={['Home']}
        selectedKeys={[currentPage]}
        onClick={({ key }) => handlePageChange(key)}
      >
            <Menu.Item key="Home">
          <Text level={5} style={{ color: 'white' }}>Home</Text>
        </Menu.Item>
        <Menu.Item key="Attractions">
          <Text level={5} style={{ color: 'white' }}>Attractions</Text>
        </Menu.Item>
        <Menu.Item key="PlacesToGo">
          <Text level={5} style={{ color: 'white' }}>Places to Visit</Text>
        </Menu.Item>
        <Menu.Item key="Restaurants">
          <Text level={5} style={{ color: 'white' }}>Restaurants</Text>
        </Menu.Item>
      </Menu>

    </Header>
  );
}

export default NavTabs;
